import React, {useState} from 'react';

function TodoList(props) {

    const [count, setCount] = useState(3);

    let increment = () => {
        setCount(count = count + 1)
    }

    return (
        <div>
            Hello World {props.name}
            <span>{count}</span>
            <button onClick={increment}>increment</button>
        </div>
    )
}

export default TodoList;
